import "../style/cardinput.scss"; 
import logo from "../assets/logo.png";
const CardInput = () => {
    return (
    <div className='cardInput'>
        <div className="logoSection">
            <img src={logo}/>
        </div>
    </div>)
}

export default CardInput;
